INSERT INTO `node` VALUES (133,'杭州西湖风景名胜区-梅家坞',1,1,0,'梅家坞不是一个有意打造的景区，而是一个自然形成的采茶村落。这是一个拥有600多年历史的茶文化古村，几十年来共接待过上百个国际名人和国家元首。在这里可以体验历史悠久的茶文化。',5.00,'AE',0.310700,NULL,NULL,1),(134,'真际院',1,1,20,'真际院是雁荡十八古刹之一，是一座亦佛亦道的寺院。它坐落在五云山上，寺内有五口井，映射出天上的彩云，成为五云山名字的由来。在真际院的茶室中，吹着飒爽凉风，观婆娑树姿，望重叠山色，实在是一种美的享受。',4.00,'BD',0.530270,NULL,NULL,2),(135,'梅坞春早',1,1,0,'梅坞春早是西湖十景之九。梅家坞溪谷深广，常年草木繁盛，峰峦叠翠，即使数九寒冬，也不掩如春天气象。梅家坞盛产茶叶，为“西湖龙井”中的珍品。',4.70,'AC',0.706291,NULL,NULL,3),(136,'瞭望亭',1,1,0,'坐落于山上，适合登山徒步。可以将西湖全景和山下错落的梯田村落尽收眼底。',5.00,'DE',0.502837,NULL,NULL,4),(137,'九溪十八涧',1,1,0,'九溪十八涧位于西湖之西的群山中，景色天然，少有匠气。游人可涉水溪中，也可自石上鹤步而过，各有意趣。',4.60,'CD',0.374222,NULL,NULL,5),(138,'理安寺',1,1,30,' 理安寺古称涌泉禅寺，因寺内有与虎跑泉齐名的“法雨泉”也称法雨寺。别致的建筑风格加之周边清雅的山水景物，曾激发无数文人墨客的灵感，在这里留下许多题咏。',4.50,'BF',0.378496,NULL,NULL,6),(139,'梵音亭',1,1,0,'一座现代重修的亭子，周围有花海、密林，适合徒步者休息。',3.90,'CD',0.436369,NULL,NULL,7),(140,'杭州西湖风景名胜区-九曲亭',1,1,0,'九曲亭连着九曲桥，漫步桥上，颇有雅趣。',3.70,'GH',0.120090,NULL,NULL,8),(141,'杭州西湖风景名胜区-龙井八景',1,1,0,'所谓八景，是指“风篁岭、过溪亭、涤心沼、一片云、方圆庵、龙泓涧、神运石和翠峰阁”。乾隆格外喜欢此地，留下了众多诗篇。',4.00,'CF',0.038894,NULL,NULL,9),(142,'杭州西湖风景名胜区-杨梅岭',1,1,0,'漫步于杭州西湖风景名胜区的杨梅岭，感受清新空气，欣赏湖光山色。登上观景台，俯瞰整个西湖风光，美不胜收。沿途可见古树参天，翠竹掩映，让人置身自然怀抱，心旷神怡。',3.70,'CDE',0.284659,NULL,NULL,10),(143,'杭州动物园',1,1,0,'园内有大熊猫、大象等珍稀动物，动物种类丰富，提供杂技表演、餐饮服务等。',4.70,'J',0.786938,NULL,NULL,11),(144,'虎跑公园',1,1,20,'围绕虎跑寺建立的公园。园内有天然泉水，可以聆听清泉叮咚，感受大自然的宁静。虎跑寺更是具有江南特色的私家园林。',4.70,'HL',0.044230,NULL,NULL,12),(145,'六和塔文化公园',1,1,20,'登高望远，逸兴遄飞。登上六和塔，俯瞰钱塘江的壮丽景色，感受历史与自然的融合。',4.50,'GL',0.435931,NULL,NULL,13),(146,'纯阳殿',1,1,0,'此地融池泉亭台于山川沟壑、茂林修竹之间，游人沿着曲折石阶向上攀登，有移步换景，豁然开朗之感，不得不佩服能工巧匠的巧夺天工。',4.40,'BCD',0.113572,NULL,NULL,14),(147,'古香禅院',1,1,0,'永福寺的一角，可以品茶。',4.50,'B',0.273260,NULL,NULL,15),(148,'杭州永福寺',1,1,0,'此寺的历史可以追溯到西晋时期，是佛教传入中国的桥头堡。它拥有七进、五殿、三堂、两阁、两楼、五亭，以及千余棵古树名木，是佛教文化的活化石。',4.70,'BC',0.559442,NULL,NULL,16),(149,'灵隐飞来峰',1,1,0,'飞来峰是一座石灰岩山，其上厅岩怪石，如蛟龙，如奔象，如卧虎，如惊猿，仿佛是一座石质动物园。老树古藤，盘根错节；岩骨暴露，峰棱如削。山上点缀着五代以来的石窟刻像，极具美学和史学价值。',4.60,'BCD',0.557221,NULL,NULL,17),(150,'济公殿',1,1,0,'坐落于灵隐寺中，可以追溯到东晋时期。其中铜制佛像神情各异，细致生动，为佛教艺术之瑰宝。',4.60,'B',0.706873,NULL,NULL,18),(151,'史量才墓',1,1,0,'史量才原籍江苏江宁，清末曾任上海《时报》主笔，《申报》的创始人。他抨击国民政府的腐败投降政策，被暗杀后安葬于此，供后世人凭吊。',3.50,'I',0.832301,NULL,NULL,19),(152,'徐锡麟烈士墓',1,1,0,'徐锡麟是清末的革命志士，为中国的共和献身。慷慨告天下，灭虏志无渝。长啸赴东市，剖心奚足辞！',4.00,'I',0.287529,NULL,NULL,20),(153,'杭州西湖风景名胜区-秦亭',1,1,0,'位于西湖风景区边的秦亭山上。可以俯瞰杭州城。',3.00,'CD',0.507110,NULL,NULL,21),(154,'美女山',1,1,0,'可以俯视杭州市区，饱览美景。',4.80,'CD',0.928194,NULL,NULL,22),(155,'灵峰探梅',1,1,0,'植有多种梅花的赏梅胜地。在这青山环抱，树木葱郁的幽谷中，草地如茵，梅林似海，楼阁参差，暗香浮动，景色十分诱人。',4.50,'C',0.996803,NULL,NULL,23),(156,'杭州西湖风景名胜区-状元峰',1,1,0,'四周峰峦奔突、云山雾沼，晴日里鲤鱼湖碧波万顷，溪流蛇行蜿蜒山间；远眺东海则浩缈接天，岛屿若隐若现，游人疑入海上瀛洲。羊肠小道，石径幽邃，拾级登高，可瞰全城景色。',3.30,'CD',0.605141,NULL,NULL,24),(157,'漱碧',1,1,0,'一个开阔如镜的小湖。湖岸遍植水杉，草木繁盛，倒影婆娑。就在湖径之间，有一六角攒尖的亭子临水而筑，是为漱碧亭。此地匠气微弱，颇有情趣，适合歇脚。',4.00,'EG',0.159838,NULL,NULL,25),(159,'杭州植物园',1,1,0,'植物种类丰富，是著名的科普教育基地。',4.60,'CJ',0.895788,NULL,NULL,26),(161,'撷翠亭',1,1,0,'周围景色有江南园林气象。',5.00,'H',0.670289,NULL,NULL,27),(162,'双峰插云',1,1,0,'南高峰、北高峰，是古时候西湖群山中喧盛一时的佛教名山，山顶都建有佛寺、佛塔。春秋佳日，岚翠雾白，塔尖时隐时显，自西湖舟中远观，景观独标一格。',4.60,'BCD',0.663097,NULL,NULL,28),(164,'竹类植物区',1,1,0,'杭州植物园的一部分。',5.00,'CJ',0.736459,NULL,NULL,29),(165,'曲院风荷',1,1,0,'南宋时，此有一座官家酿酒的作坊，取金沙涧的溪水造曲酒，闻名国内。附近的池塘种有菱荷，每当夏日风起，酒香荷香沁人心脾。',4.80,'ACG',0.462881,NULL,NULL,30),(166,'郭庄景点',1,1,0,'紧邻曲院风荷，是一座小巧的江南园林。园内以池塘为中心，每到夏季，这里还能欣赏湖边盛开的荷花，湖风拂面，很是清凉。',4.40,'CH',0.437946,NULL,NULL,31),(167,'神舟基地',1,1,0,'“神舟基地”是杭州摄影人对杨公堤旁一组被常年固定着的小舟的戏称。这里本无名气，因为摄影爱好者发现这里的朝阳、夕阳景色世间少有，才有了这个有些幽默的名字。',4.30,'CEG',0.483271,NULL,NULL,32),(168,'美景房车茅家埠营地',1,1,0,'房车营地。宽阔的草坪为露营的家庭提供了完美的空间。',4.00,'CJ',0.820944,NULL,NULL,33),(169,'704工程',1,1,0,'林彪为准备政变修建的住所、指挥所。建筑高度要塞化，建有完备的地下防御设施，配备厚重的钢门，几乎是一座要塞。',4.10,'IK',0.013263,NULL,NULL,34),(170,'杭州西湖风景名胜区-于谦墓',1,1,0,'墓为石结构，呈马蹄形。墓道两侧分置石人、石马、石虎、石羊、石犬各一对，墓道前建石牌坊一座。周围以自然林为屏障，夹道翠柏林立，气势雄伟，保存良好。',4.80,'I',0.139461,NULL,NULL,35),(171,'艺人盖叫天墓',1,1,0,'盖叫天原名张英杰，著名京剧表演艺术大师，其表演艺术以武生戏为主，主张武戏文唱，自成盖派特色，有江南活武松之誉。',4.60,'AF',0.066991,NULL,NULL,36),(172,'景行古桥',1,1,0,'杨孟瑛重新疏浚西湖、惠及后人，人们用“景行行止”来赞颂他，将他修建的桥称作“景行桥”，也有赞美桥宽阔的意思。该桥是杨公堤六桥中唯一保存至今的，所以可称古桥。',4.60,'G',0.903536,NULL,NULL,37),(173,'芍药圃',1,1,0,'内有疏林草地，芍药圃等景点，园内更是种植芍药2000余株，绰约多姿，仿佛置身植物的海洋。',3.70,'CL',0.461874,NULL,NULL,38),(174,'东坡亭',1,1,0,'似是苏轼寓居西湖时的住所，系近年重修。不过历史细节已经无从考究了。',4.40,'F',0.078551,NULL,NULL,39),(175,'一炽松树',1,1,0,'一个岔路口，有着让人眼前一亮的名字。或许真有松树？',3.10,'Z',0.025433,NULL,NULL,40),(176,'九曜阁',1,1,0,'坐落于少有人至的九曜山上。是小众景点，特别受徒步登山者的喜爱。可以俯瞰整个西湖。',4.40,'CDE',0.443578,NULL,NULL,41),(177,'太子湾公园',1,1,0,'适合赏樱的花园。其中花草树木相得益彰，另有广阔的草坪。',4.70,'CJL',0.044601,NULL,NULL,42),(178,'大风车',1,1,0,'太子湾公园内的风车。每个孩子的心中或许都有一个风车梦吧。',4.50,'JK',0.216484,NULL,NULL,43),(179,'魏源墓',1,1,0,'魏源，近代中国开眼看世界的第一人。学习魏源的事迹，可以了解近代知识分子的思想史，以古鉴今。',4.30,'I',0.600056,NULL,NULL,44),(180,'挹江亭',1,1,0,'此亭长方形，十二柱单檐攒尖，体量宽大，风格与西湖各景区主亭一致。亭虽著名，却无楹联。',4.90,'GK',0.523091,NULL,NULL,45),(181,'雷峰塔景区',1,1,30,'当年是是吴越国王钱俶为供奉佛螺髻发舍利、祈求国泰民安而建。该塔于2002年重建。',4.50,'G',0.555938,NULL,NULL,46),(182,'苏堤',1,1,0,'这里是苏堤的起点。苏堤为苏轼在杭为官时所建，是西湖十景之首，上有六桥，有水利、审美之效。',4.70,'G',0.474462,NULL,NULL,47),(183,'锁澜桥',1,1,0,'锁澜桥，苏堤的第二桥，是一座半圆石拱桥。西湖（指外西湖）上本来波光粼粼，一过锁澜桥，呈现在面前的西里湖水竟然一下子变得无比平静，犹如一面大大的绿镜子。',4.20,'G',0.231471,NULL,NULL,48),(184,'压堤桥',1,1,0,'苏堤的第四桥，也是眺望全湖的最佳处之一，好似西湖的“压轴”之桥。',5.00,'G',0.688123,NULL,NULL,49),(185,'东浦桥',1,1,0,'西湖苏堤的第五桥，是一座半圆石拱桥。',3.80,'G',0.887976,NULL,NULL,50),(186,'钱塘苏小小之墓',1,1,0,'苏小小是中国古代文学中的一个经典形象，正史中并无记载。多作为才貌双全的佳人形象出现在诗歌、小说等文学作品中。此处可谓是文化胜地。',4.40,'AFG',0.686126,NULL,NULL,51),(187,'紫云洞',1,1,0,'紫云洞位于杭州栖霞岭上，是此地较大较奇特的洞穴，洞厅宽敞，清凉如秋，洞内外分二进，是典型的哑铃形状。阳光照射在洞中，会呈现出美丽的紫色云烟样子的光线，朦胧如仙境，故名紫云洞。',4.60,'BD',0.269314,NULL,NULL,52),(188,'黄龙吐翠',1,1,50,'阳光照射在洞中，会呈现出美丽的紫色云烟样子的光线，朦胧如仙境，故名紫云洞。南宋以来，这里作为西湖上五大祀龙点之一而享有盛名。如今被建设为仿古游乐园。',4.00,'ACD',0.764927,NULL,NULL,53),(189,'宝石山',1,1,0,'山中常有几块巨石搭起来的空穴，细缝，游人就如小鱼，移进移出。沿着山路前行，可以游览各种石刻古迹。',4.80,'BD',0.420292,NULL,NULL,54),(190,'北街寻梦',1,1,70,'以秀美山水为载体，以历史文化为灵魂，以近代建筑为骨架，集自然与人文景观为一体的历史、文化街区。其中近代以来的历史遗迹不可胜数。',4.80,'AGIJK',0.298689,NULL,NULL,55),(191,'云水光中',1,1,0,'白堤的始点。有词曰：“水月光中，烟霞影里，涌出楼台。室外萧笙，云间笑话，人在蓬莱。天香暗逐风回，近十里荷花盛开，买个扁舟，山南游遍，山北归来。”',4.30,'CG',0.088175,NULL,NULL,56),(192,'白堤',1,1,0,'春桃夏柳、秋桂冬雪，四季皆有美景可供欣赏。',4.70,'CG',0.271350,NULL,NULL,57),(193,'平湖秋月',1,1,0,'立于此处，每当清秋气爽，西湖湖面平静如镜，皎洁的秋月当空，月光与湖水交相辉映，颇有“一色湖光万顷秋”之感。',4.70,'G',0.286314,NULL,NULL,58),(194,'海娃塑像',1,1,0,'抗战电影《鸡毛信》中主角“海娃”的塑像。',4.40,'J',0.171969,NULL,NULL,59),(195,'沙孟海旧居',1,1,35,'沙孟海是我国著名书法家。沙孟海故居为中西结合式的花园别墅，建于1920年代。',4.20,'FK',0.417459,NULL,NULL,60),(196,'音乐喷泉观赏区',1,1,0,'西湖湖畔公园的一部分。',4.40,'GJL',0.774610,NULL,NULL,61),(197,'西湖外事游船',1,1,100,'可以乘船泛舟西湖。',4.50,'JZ',0.879638,NULL,NULL,62),(199,'涌金公园',1,1,40,'由涌金池，涌金广场以及湖边绿地组成的，是西湖环湖众多公园的一个。其中亦有码头。',4.70,'GL',0.080850,NULL,NULL,63),(200,'钱王祠',1,1,50,'钱王祠是后人为纪念吴越国钱王功绩而建造的。陈列钱氏相关的史迹，以声、光、电的高科技手法再现“钱王修筑海塘”等历史场景，古韵浓郁，情趣盎然。其中有古戏台，上演传统戏剧。',4.60,'AIJ',0.444080,NULL,NULL,64),(201,'柳浪闻莺公园',1,1,10,'南宋时，这里是京城最大的御花园。柳丛衬托着紫楠、雪松、广玉兰、梅花等异木名花。临水眺望，视野开阔，空气清新，令人心旷神怡。',4.70,'CG',0.385118,NULL,NULL,65),(202,'学士公园',1,1,0,'西湖湖畔公园之一。草坡起伏、杉林片片、溪流清浅。',4.10,'CG',0.367906,NULL,NULL,66),(203,'华君武',1,1,0,'漫画家华君武的纪念馆。坐落于长桥公园中。',4.60,'FL',0.726940,NULL,NULL,67),(204,'环翠楼',1,1,20,'原为登城隍山之便道，路边屋舍相连。南宋徽宗时有徐姓道士居于此，故曾名大隐坊。明代在山路两侧植树栽木，清翠环山，绿阴蔽屋，拾级而上，如入画屏，因名环翠楼。',5.00,'BC',0.116213,NULL,NULL,68),(205,'紫阳街道游客服务中心',1,1,0,'游客服务中心。',3.30,'Z',0.887532,NULL,NULL,69),(206,'玄朗洞',1,1,0,'湖山深处，别有洞天。',3.70,'DE',0.734462,NULL,NULL,70),(207,'万松书院',1,1,20,'儒学圣地。王阳明曾在此讲学，现存有\"万世师表\"四字的牌坊一座和依稀可见\"至圣先师孔子像\"的石碑等物。',4.40,'F',0.762532,NULL,NULL,71),(208,'杭州宣和美术馆',0,1,150,'私营美术馆。最新消息显示该地已经废弃。',1.00,'Z',0.420047,NULL,NULL,72),(209,'凤凰山上凤凰亭',1,1,0,'登临凤凰山，凭栏新凤凰亭，可概览新唐山之全貌，感受凤凰城雄起之势。',2.40,'CD',0.796232,NULL,NULL,73),(210,'圣果寺遗址',1,1,10,'圣果寺毁于倭寇入侵。现存有多处古迹。 “三佛石”即西方三圣，高约10米，应为杭州最大的佛像。四周有“十六罗汉像”及多处摩崖题刻。',4.00,'B',0.836876,NULL,NULL,74),(211,'宋韵文化园',1,1,150,'宋韵主题文化园区，重现了宋朝京城的盛景，展现当时的社会风貌。',3.60,'AJ',0.731074,NULL,NULL,75),(212,'将台山',1,1,0,'山中有吴越国、南宋史迹，另有一座千佛龛，在南方独一无二。将台山在古代，曾是英雄厉兵秣马、谋取天下之处。',3.50,'BDI',0.669730,NULL,NULL,76),(213,'玉皇山景区',1,1,0,'远望如巨龙横卧，雄姿俊法,风起云涌时，但见湖山空阔，江天浩瀚，境界壮伟高远,史称“万山之祖”。',4.60,'D',0.549098,NULL,NULL,77),(214,'石龙洞造像',1,1,0,'玉皇山中的千佛龛。这类雕像在南方地区独一无二，具有极高的考古价值。又有北宋年间的刻字《心印铭》。',4.00,'BDF',0.249731,NULL,NULL,78),(215,'西湖风景名胜区-海月亭',1,1,20,'一座有湖水点缀的公园。',3.90,'CGL',0.684095,NULL,NULL,79),(216,'郊坛下和老虎洞窑址',1,1,10,'南宋为烧造御用瓷器而专门设置的窑场，展现古代中国令人称奇的制造技艺。',4.50,'A',0.612660,NULL,NULL,80),(218,'俶影桥',1,1,0,'杭州西湖俶影桥又叫“九曲桥”，整个桥置入湖中，湖光山色，美景盈目，每天游人如织，驻足赏景。',4.20,'G',0.526326,NULL,NULL,81);
